import React, {useState} from "react";

function Demo(){
    const[product,setProduct]= useState(["Gopal","Urvish"])

    return(
        <ul>
            {product.map((p)=>(
                <li>{p}</li>
            ))}
        </ul>
    )
}

export default Demo;
